#' Select background list for Over Representation Analysis (ORA)
#'
#' `select_background()` is used to select a background list for Over Representation Analysis (ORA).
#'
#' @param background A character string specifying the background list to be used.
#'
#' @returns A character vector of gene symbols.
#' @keywords internal
select_background <- function(background){
  backgrounds <- background_lists()
  if (length(background) > 1){
    background <- background
  } else if (!background %in% names(backgrounds)){
    warning("Background list not found in available backgrounds and replaced with NULL. Please check the available background lists with hd_show_backgrounds().")
    return(NULL)
  } else {
    return(backgrounds[[background]])
  }
}


#' Show available background lists
#'
#' `hd_show_backgrounds()` is used to show the available background lists for Over Representation Analysis (ORA).
#'
#' @returns A character vector of available background lists.
#' @export
#'
#' @examples
#' hd_show_backgrounds()
hd_show_backgrounds <- function(){
  backgrounds <- background_lists()
  cat("Available background lists:\n")
  cat(paste(names(backgrounds), collapse = ", "))
  cat("\n")
}


